import React, { useState } from "react";
import TimelineInitialTypes from "./timeline_initial_type";

function TimelineInitial(props) {

    let options = [];
    
    for (let i = 0; i < props.types.length; i++) {
        options.push(
            <TimelineInitialTypes />
        );
    };

    return(
        <div className="timelineInitialWrapper">
            {options}
        </div>
    );
};

export default TimelineInitial;
